<html>
  <head>
    <title>spirodraw</title>
    <style type="text/css">/* Copyright (c) 2011, the Dart project authors.  Please see the AUTHORS file */
/* for details. All rights reserved. Use of this source code is governed by a */
/* BSD-style license that can be found in the LICENSE file. */

body {
	font-style: normal;
	font-family: sans-serif;
	font-size:0.9em;
    margin-top: 0;
    margin-bottom: 0;
	margin-left: auto;
	margin-right: auto;
	text-align: center;
	display:block;
}

.centered {
	text-align: center;
}

.full {
	width: 100%;
}

div.control {
	text-align: left;
	margin-top: 10px;
	margin-bottom: 10px;
}


select,input[type='range'] {
  width:100%;
}

div.rangeOption {
	display:table;
	width:100%;
}

div.rangeRow {
 	display:table-row;
 	width:100%;
}

.rangeOption label {
	display:table-cell;
	text-align: center;
}

.rangeOption input[type='range'] {
  display:block;
  width: 100%;
}

.rangeRow .minLabel {
  text-align: left;
}

.rangeRow .maxLabel {
  text-align: right;
}

.buttonBar {
  text-align: center;
  width:100%;
  margin-top:10px;
  margin-bottom:10px;
}

.counter {
  display: block;
  color: Gray;
  font-size: 72px;
  font-style: normal;
  font-family: sans-serif;
  font-weight: bold;
  text-align: center;
}

#wrapper {
  display: table;
}

#leftnav {
  float: left;
  width: 200px;
  margin: 10px;
  background-color: #EEEEEE;
  border: 1px solid #CCCCCC;
  border-radius: 25px 25px 25px 25px;
  padding: 1em;
}

#palette {
  cursor: pointer;
}

#lucky {
  width:100%;
}

#main {
  float:right;
}</style>
    
  </head>
  <body>
  <div id="leftnav">
    <div class="control">
      <select class="full" id="in_out" size="1">
        <option selected="None" value="-1">Wheel inside</option>
        <option value="1">Wheel outside</option>
      </select>
    </div>
  
    <div class="control">
      <label>Fixed radius</label>
      <input max="19" type="range" id="fixed_radius" value="10" min="10">
      <div class="rangeOption">
        <div class="rangeRow">
          <label>10</label>
          <label>11</label>
          <label>12</label>
          <label>13</label>
          <label>14</label>
          <label>15</label>
          <label>16</label>
          <label>17</label>
          <label>18</label>
          <label>19</label>
        </div>
      </div>
    </div>
  
    <div class="control">
      <label>Wheel radius</label>
      <input max="9" type="range" id="wheel_radius" value="3" min="0">
      <div class="rangeOption">
        <div class="rangeRow">
          <label>0</label>
          <label>1</label>
          <label>2</label>
          <label>3</label>
          <label>4</label>
          <label>5</label>
          <label>6</label>
          <label>7</label>
          <label>8</label>
          <label>9</label>
        </div>
      </div>
    </div>
  
    <div class="control">
      <label>Pen radius</label>
      <input max="9" type="range" id="pen_radius" min="0">
      <div class="rangeOption">
        <div class="rangeRow">
          <label>0</label>
          <label>1</label>
          <label>2</label>
          <label>3</label>
          <label>4</label>
          <label>5</label>
          <label>6</label>
          <label>7</label>
          <label>8</label>
          <label>9</label>
        </div>
      </div>
    </div>
  
    <div>
      <canvas width="180" id="palette" height="160"/>
    </div>
    
    <div class="control">
      <label>Pen thickness</label>
      <input max="10" type="range" id="pen_width" min="1">
    </div>
  
    <div class="control">
      <div class="rangeOption">
        <div class="rangeRow">
          <label class="minLabel">Smoother</label>
          <label class="maxLabel">Faster</label>
        </div>
      </div>
      <input max="20" type="range" id="speed" value="15" min="1">
    </div>
    
    <div class="control">
      <div class="buttonBar">
        <input type="button" id="lucky" value="I'm feeling lucky!"></input>
      </div>
      <div class="buttonBar">
        <input type="button" id="start" value="Start"></input>
        <input type="button" id="stop" value="Stop"></input>
        <input type="button" id="clear" value="Clear"></input>
      </div>
    </div>
    
    <div class="control,centered">
      <label># turns</label>
      <label id="num_turns" class="counter">0</label>
    </div>
  </div>
  
  <div id="main">
    <canvas id="canvas"/>
  </div>
